  body: "Previous to this change the nesting of aggregation profiling results\nwould\
    \ be incorrect when the request contains a terms aggregation and the\ncollect\
    \ mode is (implicitly or explicitly) set to `breadth_first`. This\nwas because\
    \ the aggregation profiling has to make the assumption that\nthe `preCollection()`\
    \ method of children aggregations is always called in\nthe `preCollection()` method\
    \ of their parent aggregation. When the collect\nmode is `breadth_first` the `preCollection`\
    \ of the children aggregations\nwas delayed until the documents were replayed.\n\
    \nThis change moves the `preCollection()` of deferred aggregations to run\nduring\
    \ the `preCollection()` of the parent aggregation. This should have\nno adverse\
    \ impact on the breadth_first mode as there is no allocation of\nmemory in any\
    \ of the aggregations.\n\nWe also apply the same logic to the diversified sampler\
    \ aggregation as\nwe did to the terms aggregation to move the `preCollection()`\
    \ of the\nchild aggregations method to be called during the `preCollection()`\
    \ of\nthe parent aggregation.\n\nThis commit also includes a fix so that the `ProfilingLeafBucketCollector`\n\
    propagates the scorer to its delegate so the diversified sampler agg works\nwhen\
    \ profiling is enabled.\n\nExample recreation of the bug:\n\n```\nDELETE /data\n\
    \nPUT /data\n{\n  \"settings\": {\n    \"number_of_shards\": 2\n  },\n  \"mappings\"\
    : {\n    \"data\": {\n      \"_all\": {\n        \"enabled\": false\n      },\n\
    \      \"_source\": {\n        \"enabled\": false\n      },\n      \"properties\"\
    : {\n        \"node\": {\n          \"type\": \"short\"\n        },\n        \"\
    query\": {\n          \"type\": \"short\"\n        },\n        \"metric\": {\n\
    \          \"type\": \"short\"\n        },\n        \"hour\": {\n          \"\
    type\": \"date\"\n        },\n        \"value\": {\n          \"type\": \"float\"\
    \n        },\n        \"disruption\": {\n          \"type\": \"short\"\n     \
    \   }\n      }\n    }\n  }\n}\n\nPOST /data/data\n{\n \"node\": 0,\n \"metric\"\
    : 1,\n \"query\": 0,\n \"hour\": \"2015-10-20T00:00:00\",\n \"value\": 58.7593984070142,\n\
    \ \"disruption\": 0\n}\nPOST /data/data\n{\n \"node\": 1,\n \"metric\": 2,\n \"\
    query\": 1,\n \"hour\": \"2015-10-20T00:01:00\",\n \"value\": 56.7593984070142,\n\
    \ \"disruption\": 0\n}\nPOST /data/data\n{\n \"node\": 2,\n \"metric\": 3,\n \"\
    query\": 2,\n \"hour\": \"2015-10-20T00:02:00\",\n \"value\": 52.7593984070142,\n\
    \ \"disruption\": 0\n}\n\nGET /data/_search\n{\n  \"size\": 0,\n  \"profile\"\
    : true,\n  \"query\": {\n    \"constant_score\": {\n      \"filter\": {\n    \
    \    \"term\": {\n          \"disruption\": \"0\"\n        }\n      }\n    }\n\
    \  },\n  \"aggs\": {\n    \"histo\": {\n      \"date_histogram\": {\n        \"\
    field\": \"hour\",\n        \"interval\": \"minute\"\n      },\n      \"aggs\"\
    : {\n        \"node\": {\n          \"terms\": {\n            \"field\": \"node\"\
    ,\n            \"size\": 10\n          },\n          \"aggs\": {\n           \
    \ \"metric\": {\n              \"terms\": {\n                \"field\": \"metric\"\
    ,\n                \"size\": 10\n              },\n              \"aggs\": {\n\
    \                \"value_stats\": {\n                  \"stats\": {\n        \
    \            \"field\": \"value\"\n                  }\n                },\n \
    \               \"value_percentiles\": {\n                  \"percentiles\": {\n\
    \                    \"field\": \"value\",\n                    \"percents\":\
    \ [\n                      1,\n                      5,\n                    \
    \  25,\n                      50,\n                      75,\n               \
    \       95,\n                      99\n                    ]\n               \
    \   }\n                },\n                \"query_cardinality\": {\n        \
    \          \"cardinality\": {\n                    \"field\": \"query\"\n    \
    \              }\n                }\n              }\n            }\n        \
    \  }\n        }\n      }\n    }\n  }\n}\n```\n\nThis is the response of the search\
    \ request above, notice how the `metric` agg is not correctly positioned, it shoudl\
    \ be a child of the `node` agg but instead is a sibling:\n\n```\n\"aggregations\"\
    : [\n          {\n            \"type\": \"org.elasticsearch.search.aggregations.bucket.histogram.DateHistogramAggregator\"\
    ,\n            \"description\": \"histo\",\n            \"time\": \"2367.893957ms\"\
